import React from 'react';
import './Header.css'

const Header = () => {
	return (
		<div>
			<div className='ttu pv7 pl7 mv5'>
				<h1 className='f2 w-90 center'>My name is <span style={{color: 'red'}} className='f1 '>Kyle Chart</span>,</h1>
				<h1 className='f2 w-90 center'>And I am a Fullstack Developer.</h1>
				<button className='Center ml7 '>Find Out More!</button>
			</div>
		</div>
	);
}

export default Header;
